import React, { useState } from 'react';

function App() {
  const [count, setCount] = useState(0);

  function handleClick() {
    setCount(count + 1);
  }

  return (
    <div>
      <h1>Jumlah Klik: {count}</h1>
      <button onClick={handleClick}>Klik Saya!</button>
    </div>
  );
};

export default App;
